import React from "react";

const ResponsiveUI = () => {
  return (
    <div
      style={{ background: "[object Object]" }}
      className="framer-o43dbh"
      data-framer-name="_HOM_Final_Out_Color 1"
      name="_HOM_Final_Out_Color 1"
    >
      <div className="framer-13og13b"></div>
      <div className="framer-i7iamu"></div>
      <div className="framer-sspr7l-container">
        <video
          src="https://framerusercontent.com/assets/oi6sebXDmnVMQbvHHKXGiG0hNw.mp4"
          loop
          playsInline
          style={{
            cursor: "auto",
            width: "100%",
            height: "100%",
            borderRadius: "0px",
            display: "block",
            objectFit: "cover",
            backgroundColor: "rgba(0, 0, 0, 0)",
            objectPosition: "50% 50%",
          }}
        ></video>
      </div>
      <div className="framer-19fb1uo"></div>
      <div className="framer-1bjreh3"></div>
    </div>
  );
};



export default ResponsiveUI;
